css:
@namespace url(http://www.w3.org/1999/xhtml);


@-moz-document domain("netvibes.com") {

@font-face {
font-family: 'uwa-icon';
font-style: normal;
font-weight: normal;
src: local('uwa-icon'),
url("data:application/x-font-woff;base64,") format("woff");
}

#top .icon {
    font-family: 'uwa-icon' !important;
    color: #dcdccc !important;
    font-weight: normal !important;
    font-size: 20px !important;
    display: inline-block !important;
    vertical-align: middle !important;
    line-height: 22px !important;
    height: 25px !important;
}

.nv-ir-article-text{
    line-height: 18px !important;
    max-width: 100% !important;
}
    
#feedReader .item-actions:before, .uwa-overlay .item-actions:before, .nv-item-renderer.open .item-actions:before, 
#feedReader .item-actions, .uwa-overlay .item-actions, .nv-item-renderer.open .item-actions,
.smartreader-header-title-extra{
    background-color: #3f3f3f !important;
    background-image: none !important;
}
    
    
.uwa-icon, .nv-ir-close-feed, #top .universal-zorch .zorch-separator, #top .universal-zorch.active .zorch-close,
.nv-treeview-section.active .nv-treeview-rowToggle::before, .nv-treeview-rowToggle::before, .nv-treeview-multiplefeedsToggle::before {
    font-family: "uwa-icon" !important;
}
body *, .doc-text, .nv-treeview-label, .uwa-button, .nv-addpanel-item-title, .nv-addpanel-item,
nv-treeview-label {
    font-family: Ubuntu, DejaVu Sans, sans !important;
    font-size: 1.014em !important;

}

.smartreader-header {
    background-color: #3f3f3f !important;
}

.nv-item-renderer.focus {
   border-left-color: #464646 !important;
}

.nv-line-item-renderer:not(.build-image):not(.this-class-does-not-exist) .item-preview-wrapper::after,
.nv-line-item-renderer:not(.build-image):not(.this-class-does-not-exist):hover .item-preview-wrapper:hover::after{
    background-image: none;
}

.smartreader-main,
.nv-line-item-renderer,
.nv-line-item-renderer .item-title,
.nv-item-renderer.focus div{
    color: #dcdccc !important;
 	background-color: #464646 !important;
}

.nv-reader-item:not(.this-class-does-not-exist) .item-preview-wrapper:after
    
{
    background-image: linear-gradient(90deg, rgba(63,63,63,0), rgba(63,63,63,255)) !important;
    
}

.group-label {
    color: #3f3f3f !important;
}
.nv-reader-item:hover {
    background-color: #464646 !important;
    border-bottom: 0px solid #dcdccc !important;
    border-top: 0 none !important;
}
.nv-reader-item:hover,
.no-touch .nv-reader-item.open:hover, .no-touch .nv-reader-item.in-expanded-view:hover {
    background-color: #464646 !important;
    border-top: 0px solid #dcdccc !important;
}

.no-touch .nv-item-renderer:hover .item-actions,
.item-actions
 {
    color: #dcdccc !important;
}

.nv-reader-item:after {
    border-bottom: 1px solid rgb(102,102,102) !important;
}

.nv-sidebar-left .nv-sidebarContainer, .nv-treeview-container {
    background: #3f3f3f !important;
}

.highlight{
    background: #464646 !important;
    border: 0 !important;
}
.nv-treeview-container li div.nv-treeview-content {
    border: 0 !important;
}

.nv-treeview-setction, .nv-treeview-row, .nv-treeview-feed {
    height: 25px !important;
}

.entry-row, .entry-body, .nv-treeview.active , .nv-treeview-row,
#smartreader-searches-main, #smartreader-widgets-main, #smartreader-feeds-main, .active ul.nv-treeview-container,
.nv-treeview-container li div.nv-treeview-content {
    background: #3f3f3f !important;
    color: #dcdccc !important;
    border: 0px !important;
}
.entry-content {
    background: #040404 !important;
    color: #dcdccc !important;
}
.moduleContent a:link, .moduleContent a:visited, a:link, a:visited {
    color: #6c6c9c !important;
}

.read .entry-row, .read .entry-row a{
    color: #709080 !important;
}
.read .entry-row, .read .entry-row, .read .entry-row .entry-title i  {
    color: #8f8f8f !important;
}

.entry-header .entry-innerPublished {
    color: #bc6c4c !important;
}

.groupItems, .nv-treeview-container ul.nv-treeview-widgets, .smartreader-widgets  {
    border: 0 !important;
}
.entry-header, .nv-treeview-header, .groupItems-title, .smartreader-widgets-header {
    background: #2e2e2e !important;
    color: #dcdccc !important;
    border: 0 !important;
}





.newItemsIncoming #smartreader-newItemsMessage, #smartreader-newItemsMessage-inner {
border: 0 none !important;
 background: #bc6c4c !important;
}

#smartreader-newItemsMessage-inner a{
 background: #9ccc9c !important;
}

.group-label {
    background-color: #8f8f8f !important;
}

.smartreader-header, .group-label {
    border: 0 !important;
}

pre {
     background-color: #2e2e2e !important;
}
}
